g.desc:
var level_syrup = svr.get( 'level_syrup');
var level_chocolate = svr.get( 'level_chocolate');
var level_vanilla = svr.get( 'level_vanilla');
var level_strawberry = svr.get( 'level_strawberry'); 
var recipe_syrup = svr.get( 'recipe_syrup');
var recipe_chocolate = svr.get( 'recipe_chocolate');
var recipe_vanilla = svr.get( 'recipe_vanilla');
var recipe_strawberry = svr.get( 'recipe_strawberry');
var sum = (+recipe_syrup) + (+recipe_chocolate) + (+recipe_vanilla) + (+recipe_strawberry);
var v;
v = svr.get( 'level_cook');
var level_cook = sum+(+v);
if (1 == svr.get('door_position')) {
alert('Cannot proceed, cooker lid close')  } else if (150 < level_cook) {
alert('Cannot proceed, cooker tank will overflow.') } else {
var syrup  = level_syrup - recipe_syrup;
var chocolate = level_chocolate - recipe_chocolate;
var vanilla = level_vanilla - recipe_vanilla;
var strawberry = level_strawberry - recipe_strawberry;
if (0 > syrup) { alert('Not enough syrup.');}
else if (0 > chocolate) { alert('Not enough chocolate.');}
else if (0 > vanilla) { alert('Not enough vanilla.');}
else if (0 > strawberry) { alert('Not enough strawberry.');}
else { svr.set( 'level_syrup', syrup);
svr.set( 'level_chocolate', chocolate);
svr.set( 'level_vanilla', vanilla);
svr.set( 'level_strawberry', strawberry);
svr.set( 'level_cook', level_cook);}
}
